In de documentaire en tegelijk het regiedebuut van Clare Lewins 'I Am Ali', 
toont zij archiefbeelden buiten de ring van Mohammed Ali, de wereldberoemde bokser 
die in 1942 in Louisville, Kentucky geboren werd onder de naam 
Cassius Marcellus Clay Jr. Familieleden, vrienden en voormalige metgezellen 
van Ali geven persoonlijke en voor zichzelf sprekende interviews. 
Het resultaat is een boeiend portret van Mohammed Ali als echtgenoot, vader, broer en vriend.


Unprecedented access to Muhammad Ali's personal archive of &quot;audio journals&quot; 
as well as interviews and testimonials from his inner circle of family and 
friends are used to tell the legend's life story.

